import styled from 'styled-components';
import Welcome from './welcome/Welcome';
import Search from './search/Search';
import Card from '../'

const Main = styled.main
`
    height: 60vh;
`;

const Body = () => {
    return(
        <Main>
            <Card/>
            <Welcome/>
            <Search/>
        </Main>
    )
}

export default Body;
